// Main function
function onLoad(){

    seasonCycle();

}


function createOrangeLeaf(){
    var container = document.getElementById("respiration");
    for (var i=1; i<=500; i++){
        var xr = Math.floor(Math.random()*350)+1;
        var yr = Math.floor(Math.random()*(370-1+1))+1;
        var wx = Math.floor(Math.random()*(23-3+1))+3;
        var wy = Math.floor(Math.random()*(39-3+1))+3;
        const orange = document.createElementNS(xmlns, "image");
        orange.setAttributeNS(null, "x", xr);
        orange.setAttributeNS(null, "y", yr);
        orange.setAttributeNS(null, "width", wx);
        orange.setAttributeNS(null, "height", wy);
        orange.setAttributeNS("http://www.w3.org/1999/xlink", "xlink:href", "data:img/png;base64,")

        var animate = document.createElementNS(xmlns, "animate");
          animate.setAttributeNS(null, "attributeName", "opacity"); 
          animate.setAttributeNS(null, "dur", "4s");
          animate.setAttributeNS(null, "values", "1;0.5;1");
          animate.setAttributeNS(null, "repeatCount", "indefinite");
        orange.appendChild(animate);

        container.appendChild(orange)
    }
    for (var i=1; i<=500; i++){
        var xr = Math.floor(Math.random()*350)+1;
        var yr = Math.floor(Math.random()*(390-1+1))+1;
        var wx = Math.floor(Math.random()*(23-3+1))+3;
        var wy = Math.floor(Math.random()*(39-3+1))+3;
        const orange = document.createElementNS(xmlns, "image");
        orange.setAttributeNS(null, "x", xr);
        orange.setAttributeNS(null, "y", yr);
        orange.setAttributeNS(null, "width", wx);
        orange.setAttributeNS(null, "height", wy);
        orange.setAttributeNS("http://www.w3.org/1999/xlink", "xlink:href", "data:img/png;base64,")

        var animate = document.createElementNS(xmlns, "animate");
          animate.setAttributeNS(null, "attributeName", "opacity"); 
          animate.setAttributeNS(null, "dur", "4s");
          animate.setAttributeNS(null, "values", "0;1;0");
          animate.setAttributeNS(null, "repeatCount", "indefinite");
        orange.appendChild(animate);

        container.appendChild(orange)
    }
}

