function nightEffect(){
    //going simple for this one
    var darkOverlay = document.createElementNS(xmlns, "rect");
    darkOverlay.setAttributeNS(null, "x", "0");
    darkOverlay.setAttributeNS(null, "y", "0");
    darkOverlay.setAttributeNS(null, "width", "372");
    darkOverlay.setAttributeNS(null, "height", "551");
    darkOverlay.setAttributeNS(null, "fill", "black");
    darkOverlay.setAttributeNS(null, "opacity", "0.5");

    document.getElementById("respiration").appendChild(darkOverlay)
}
function dayEffect(){
    var lightOverlay = document.createElementNS(xmlns, "rect");
    lightOverlay.setAttributeNS(null, "x", "0");
    lightOverlay.setAttributeNS(null, "y", "0");
    lightOverlay.setAttributeNS(null, "width", "372");
    lightOverlay.setAttributeNS(null, "height", "551");
    lightOverlay.setAttributeNS(null, "fill", "#76b7bf");
    lightOverlay.setAttributeNS(null, "opacity", "0.5");

    document.getElementById("respiration").appendChild(lightOverlay)
}

function dayCycle(){
    var day = new Date();
    //console.log(day)
    var hours = day.getHours();
    if(hours >= 19){
        createOrangeLeaf();
        nightEffect();
    }else if(hours <= 6){
        createOrangeLeaf();
        nightEffect();
    }else{
        createGreenLeaf()
        dayEffect();
    }
}
function snowEffect(){
    for(var i=1; i<500; i++){
        var snow = document.createElementNS(xmlns, "circle");
        var x = Math.floor(Math.random()*370)+1;
        var y = Math.floor(Math.random()*(370-1+1))+1;
        var r = Math.floor(Math.random()*(3-1+1))+1;
        snow.setAttributeNS(null, "cx", x);
        snow.setAttributeNS(null, "cy", y);
        snow.setAttributeNS(null, "r", r);
        snow.setAttributeNS(null, "fill", "#fff");
        snow.setAttributeNS(null, "opacity", "0.4")

        //animate
        var animate = document.createElementNS(xmlns, "animate");
          animate.setAttributeNS(null, "attributeName", "opacity"); 
          animate.setAttributeNS(null, "dur", "5s");
          animate.setAttributeNS(null, "values", "0;0.5;0.7");
          animate.setAttributeNS(null, "repeatCount", "indefinite");
        snow.appendChild(animate);

        document.getElementById("respiration").appendChild(snow);


    }
     for(var i=1; i<500; i++){
        var snow = document.createElementNS(xmlns, "circle");
        var x = Math.floor(Math.random()*350)+1;
        var y = Math.floor(Math.random()*(500-1+1))+1;
        var r = Math.floor(Math.random()*(3-1+1))+1;
        snow.setAttributeNS(null, "cx", x);
        snow.setAttributeNS(null, "cy", y);
        snow.setAttributeNS(null, "r", r);
        snow.setAttributeNS(null, "fill", "#fff");
        snow.setAttributeNS(null, "opacity", "0.4")
        //animate
        var animate = document.createElementNS(xmlns, "animate");
          animate.setAttributeNS(null, "attributeName", "opacity"); 
          animate.setAttributeNS(null, "dur", "5s");
          animate.setAttributeNS(null, "values", "0.7;0.5;0");
          animate.setAttributeNS(null, "repeatCount", "indefinite");
        snow.appendChild(animate);

        document.getElementById("respiration").appendChild(snow);
    }
}

function winterDayCycle(){
    var day = new Date();
    //console.log(day)
    var hours = day.getHours();
    if(hours >= 19){
        //createOrangeLeaf();
        nightEffect();
    }else if(hours <= 6){
        //createOrangeLeaf();
        nightEffect();
    }else{
        dayEffect(); //createGreenLeaf()
    }
}

function seasonCycle(){
    var season
    var date = new Date();

    var month = date.getMonth();

    var northTimezones = ['Europe/London', 'Europe/Berlin', 'Europe/Moscow', 'Europe/Rome', 'America/Los_Angeles', 'Asia/Calcutta', 'Asia/Shanghai', 'Asia/Tokyo', 'Canada/Atlantic'];

    var southTimezones = ['Africa/Nairobi', 'Africa/Johannesburg', 'America/Sao_Paulo', 'Australia/Perth', 'Australia/Melbourne', 'Pacific/Auckland']

    let zone = Intl.DateTimeFormat().resolvedOptions().timeZone
    //console.log(zone);

    const seasonMonth = date =>  Math.floor((month/12*4))%4;

    //Northern hemisphere
    var northSeason = ['Winter', 'Spring', 'Summer', 'Autumn'][seasonMonth(date)]

    //Southern hemisphere
    var southSeason = ['Summer', 'Autumn', 'Winter', 'Spring'][seasonMonth(date)]

    //find zone
    const north = northTimezones.includes(zone); //returns true/false
    //console.log(north)
    const south = southTimezones.includes(zone); //returns true/false
    //console.log(south)

    //create tree
    if (north){
            season = northSeason;
            console.log(season);

            //decide to add leaves
            switch(season){
                case "Winter":
                winterDayCycle();
                snowEffect();
                break;

                case "Spring":
                dayCycle();
                break;

                case "Summer":
                dayCycle();
                break;

                case "Autumn":
                dayCycle();
                break;

                default:
                dayCycle();
                break;
            }

    }else if(south){
            console.log(zone)
            season = southSeason;
            console.log(season);
            //createTree();

            //decide to add leaves
            //dayCycle();
            switch(season){
                case "Summer":
                dayCycle();
                break;

                case "Autumn":
                dayCycle();
                break;

                case "Winter":
                winterDayCycle();
                snowEffect();
                break;

                case "Spring":
                dayCycle();
                break;

                default:
                dayCycle();
                break;
            }

    }else{
        dayCycle();
    }



}
